	X['a'][pv,hc] += 0.5 * np.einsum('jaiu,uvwx,wxjv->ai', h['aa'][c,v,c,a], lambdas['aa'], t['aa'][pa,pa,hc,ha], optimize=True)
	X['a'][pv,hc] += 1.0 * np.einsum('jaiu,uUvV,vVjU->ai', h['aa'][c,v,c,a], lambdas['ab'], t['ab'][pa,pA,hc,hA], optimize=True)
