	X['a'][pv,hc] += -1.0 * np.einsum('jIiA,aAjI->ai', h['ab'][c,C,c,V], t['ab'][pv,pV,hc,hC], optimize=True)
	X['a'][pv,hc] += 1.0 * np.einsum('jUiV,uVvU,vaju->ai', h['ab'][c,A,c,A], lambdas['ab'], t['aa'][pa,pv,hc,ha], optimize=True)
