def H_T_ncomm2_nbody1(X, h, t, gamma1, eta1, lambdas, orbspace, verbose=False):
	tic = time.time()
	c = orbspace['core_alpha']
	C = orbspace['core_beta']
	a = orbspace['active_alpha']
	A = orbspace['active_beta']
	v = orbspace['virt_alpha']
	V = orbspace['virt_beta']
	hc = orbspace['hole_core_alpha']
	hC = orbspace['hole_core_beta']
	ha = orbspace['hole_active_alpha']
	hA = orbspace['hole_active_beta']
	pa = orbspace['particle_active_alpha']
	pA = orbspace['particle_active_beta']
	pv = orbspace['particle_virt_alpha']
	pV = orbspace['particle_virt_beta']

	# A|V
	X['b'][pV,hA] += 1.0 * np.einsum('uv,wx,ivwa,ai,xAuU->AU', eta1['a'], gamma1['a'], h['aa'][c,a,a,v], t['a'][pv,hc], t['ab'][pa,pV,ha,hA], optimize=True)
	X['b'][pV,hA] += -1.0 * np.einsum('uv,wx,ixua,ai,vAwU->AU', eta1['a'], gamma1['a'], h['aa'][c,a,a,v], t['a'][pv,hc], t['ab'][pa,pV,ha,hA], optimize=True)
	X['b'][pV,hA] += -1.0 * np.einsum('uv,wx,vIwB,BI,xAuU->AU', eta1['a'], gamma1['a'], h['ab'][a,C,a,V], t['b'][pV,hC], t['ab'][pa,pV,ha,hA], optimize=True)
	X['b'][pV,hA] += -1.0 * np.einsum('uv,wx,xIuB,AI,vBwU->AU', eta1['a'], gamma1['a'], h['ab'][a,C,a,V], t['b'][pV,hC], t['ab'][pa,pV,ha,hA], optimize=True)
	X['b'][pV,hA] += 1.0 * np.einsum('uv,wx,xIuB,BI,vAwU->AU', eta1['a'], gamma1['a'], h['ab'][a,C,a,V], t['b'][pV,hC], t['ab'][pa,pV,ha,hA], optimize=True)
	X['b'][pV,hA] += -1.0 * np.einsum('uv,ijua,ai,vAjU->AU', eta1['a'], h['aa'][c,c,a,v], t['a'][pv,hc], t['ab'][pa,pV,hc,hA], optimize=True)
	X['b'][pV,hA] += -1.0 * np.einsum('uv,iIuU,AI,vi->AU', eta1['a'], h['ab'][c,C,a,A], t['b'][pV,hC], t['a'][pa,hc], optimize=True)
	X['b'][pV,hA] += -1.0 * np.einsum('uv,iIuB,AI,vBiU->AU', eta1['a'], h['ab'][c,C,a,V], t['b'][pV,hC], t['ab'][pa,pV,hc,hA], optimize=True)
	X['b'][pV,hA] += 1.0 * np.einsum('uv,iIuB,BI,vAiU->AU', eta1['a'], h['ab'][c,C,a,V], t['b'][pV,hC], t['ab'][pa,pV,hc,hA], optimize=True)
	X['b'][pV,hA] += -1.0 * np.einsum('VW,uv,iIuV,AI,vWiU->AU', eta1['b'], eta1['a'], h['ab'][c,C,a,A], t['b'][pV,hC], t['ab'][pa,pA,hc,hA], optimize=True)
	X['b'][pV,hA] += 0.5 * np.einsum('VW,XY,IJVX,AI,WYJU->AU', eta1['b'], eta1['b'], h['bb'][C,C,A,A], t['b'][pV,hC], t['bb'][pA,pA,hC,hA], optimize=True)
	X['b'][pV,hA] += -1.0 * np.einsum('VW,uv,vIaV,AI,aWuU->AU', eta1['b'], gamma1['a'], h['ab'][a,C,v,A], t['b'][pV,hC], t['ab'][pv,pA,ha,hA], optimize=True)
	X['b'][pV,hA] += 1.0 * np.einsum('VW,XY,iWaX,ai,YAUV->AU', eta1['b'], gamma1['b'], h['ab'][c,A,v,A], t['a'][pv,hc], t['bb'][pA,pV,hA,hA], optimize=True)
	X['b'][pV,hA] += -1.0 * np.einsum('VW,XY,iYaV,ai,WAUX->AU', eta1['b'], gamma1['b'], h['ab'][c,A,v,A], t['a'][pv,hc], t['bb'][pA,pV,hA,hA], optimize=True)
	X['b'][pV,hA] += -1.0 * np.einsum('VW,XY,IWXB,BI,YAUV->AU', eta1['b'], gamma1['b'], h['bb'][C,A,A,V], t['b'][pV,hC], t['bb'][pA,pV,hA,hA], optimize=True)
	X['b'][pV,hA] += -1.0 * np.einsum('VW,XY,IYVB,AI,WBUX->AU', eta1['b'], gamma1['b'], h['bb'][C,A,A,V], t['b'][pV,hC], t['bb'][pA,pV,hA,hA], optimize=True)
	X['b'][pV,hA] += 1.0 * np.einsum('VW,XY,IYVB,BI,WAUX->AU', eta1['b'], gamma1['b'], h['bb'][C,A,A,V], t['b'][pV,hC], t['bb'][pA,pV,hA,hA], optimize=True)
	X['b'][pV,hA] += 1.0 * np.einsum('VW,iIaV,ai,WAIU->AU', eta1['b'], h['ab'][c,C,v,A], t['a'][pv,hc], t['bb'][pA,pV,hC,hA], optimize=True)
	X['b'][pV,hA] += -1.0 * np.einsum('VW,iIaV,AI,aWiU->AU', eta1['b'], h['ab'][c,C,v,A], t['b'][pV,hC], t['ab'][pv,pA,hc,hA], optimize=True)
	X['b'][pV,hA] += -1.0 * np.einsum('VW,iWaU,AV,ai->AU', eta1['b'], h['ab'][c,A,v,A], t['b'][pV,hA], t['a'][pv,hc], optimize=True)
